text:
Marcelo de lateral = jogador aposentado em atividade;
Marcelo de meia esquerda = um excelente jogador!
Porque o Diniz não ver isso?

 @LucasSouza-lf9ui  eu já me acostumei, muito raro dar merda... Na verdade até hoje com Diniz, foram uns 2 ou 3 jogos que a saída de bola deu errado e o adversário fez o gol.

O problema é que quantos chutões deram errado, acabam devolvendo a bola no pé dos adversários e eles fazem o gol? É que a gente não conta o chutão como risco... Mas na verdade tudo tem risco.

A gente se irrita as vezes, mas sabemos que é necessário, qualifica mais os jogadores e faz eles entregarem um pouquinho mais... Pra ajudarem a construir
